2bWltb1dra2gFEh93LlShblz0DQCXP/rSp4vXPP/98x+TfzNzHexkSAAAAADx2Dt0MwNRWSgsLn2hh4ZODDgUA8Jhj5h8AAAAAHOI1AAEAAAAAAADs7NDNAEStmdfEQPnOyAAAAAAAANgbzAAEAAAAAAAAahgJQAAAAAAAAKCGkQAEAAAAAAAAatj/+Z+7fzvoGAAAAAAAAADsg2NHG/X/AY5gQIgg8OkjAAAAAElFTkSuQmCC\&quot;\n    }\n]&quot;,&quot;code&quot;:&quot;// We use the `cy.get()` command to get all elements that match the selector.\n// Then, we use `should` to assert that there are two matched items,\n// which are the two default items.\ncy.get(&#x27;.todo-list li&#x27;).should(&#x27;have.length&#x27;, 3);\n// We can go even further and check that the default todos each contain\n// the correct text. We use the `first` and `last` functions\n// to get just the first and last matched elements individually,\n// and then perform an assertion with `should`.\ncy.get(&#x27;.todo-list li&#x27;).first().should(&#x27;have.text&#x27;, &#x27;Pay electric bill&#x27;);\ncy.get(&#x27;.todo-list li&#x27;).last().should(&#x27;have.text&#x27;, &#x27;Walk the dog&#x27;);&quot;,&quot;err&quot;:{&quot;message&quot;:&quot;AssertionError: Timed out retrying after 10000ms: Not enough elements found. Found &#x27;2&#x27;, expected &#x27;3&#x27;.&quot;,&quot;estack&quot;:&quot;AssertionError: Timed out retrying after 10000ms: Not enough elements found. Found &#x27;2&#x27;, expected &#x27;3&#x27;.\n    at Context.eval (webpack:///./cypress/e2e/todo.cy.ts:24:0)&quot;,&quot;diff&quot;:&quot;- 2\n+ 3\n&quot;},&quot;uuid&quot;:&quot;557d5876-60d2-42c3-a21c-291bce7b54d6&quot;,&quot;parentUUID&quot;:&quot;e9356cd9-7e35-446a-9823-8b1bda7cb63c&quot;,&quot;isHook&quot;:false,&quot;skipped&quot;:false},{&quot;title&quot;:&quot;can add new todo items&quot;,&quot;fullTitle&quot;:&quot;example to-do app can add new todo items&quot;,&quot;timedOut&quot;:null,&quot;duration&quot;:713,&quot;state&quot;:&quot;passed&quot;,&quot;speed&quot;:&quot;fast&quot;,&quot;pass&quot;:true,&quot;fail&quot;:false,&quot;pending&quot;:false,&quot;context&quot;:null,&quot;code&quot;:&quot;// We
